import React from 'react'
import ReactDOM from 'react-dom'
import NavBar from './NavBar'
import Main from './Main'

function App(){
    return(
        <div>
            <NavBar />
            <Main />
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'))
